import { Card, List } from "antd";
import React from "react";

const AllPosts = ({post}) => {


    return(
        <>
        <List 
        grid={{
            gutter: 16,
            column: 4
        }}
        dataSource={post}
        renderItem={(item) => (
            <List.Item>
                <Card title={post.lookName}>
                    
                </Card>
            </List.Item>
        )}
        />
        </>
    );

};

export default AllPosts;
